import React, {  useState } from 'react'
import './dreamBoy.css'

const Parent = () => {
    const [a,setA] = useState(0);

    
  return (
    <div className='main'>
        <h1>Dream Boy {a}</h1>
        <div className='main2'>
        <button type='button' onClick={()=>{
            setA(a+1)}}>Increment
            </button>

        <button type='button' onClick={()=>{
            setA(a-1)}}>Decrement
            </button>

            </div>
    </div>
  )
}

export default Parent
